$(document).ready(function(){$("#select-article").on("change",function(){var t="https://api.nytimes.com/svc/topstories/v2/"+$(this).val()+".json";t+="?"+$.param({"api-key":"d182746a0d6f48f4b1247f6ea849fe15"}),$.ajax({url:t,method:"GET"}).done(function(t){$(".stories").empty(),$.each(t.results.filter(function(t){return 0!==t.multimedia.length}).splice(0,12),function(t,a){var e=a.abstract,i=a.multimedia[4].url,n=a.url;$(".stories").append('<a href="'+n+'" class="card" style="background-image: url('+i+');"><div class="words">'+e+"</div  </a>")})}).fail(function(t){throw t})})});